(52, 'default13598025461', '', 'media_information', '[51]', 'admin', 'argentina country', '', '', 'en', '&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p style=&quot;margin-top: 0.4em; margin-right: 0px; margin-left: 0px; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px;&quot;&gt;\r\n	&lt;b&gt;Argentina&lt;/b&gt;&amp;nbsp;t&amp;ecirc;n ch&amp;iacute;nh thức l&amp;agrave;&amp;nbsp;&lt;b&gt;Cộng h&amp;ograve;a Argentina&lt;/b&gt;&amp;nbsp;(&lt;a href=&quot;http://vi.wikipedia.org/wiki/Ti%E1%BA%BFng_T%C3%A2y_Ban_Nha&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Tiếng Tây Ban Nha&quot;&gt;tiếng T&amp;acirc;y Ban Nha&lt;/a&gt;:&amp;nbsp;&lt;span lang=&quot;es&quot;&gt;&lt;i&gt;Rep&amp;uacute;blica Argentina&lt;/i&gt;&lt;/span&gt;,&amp;nbsp;&lt;small&gt;ph&amp;aacute;t &amp;acirc;m&amp;nbsp;&lt;/small&gt;&lt;span class=&quot;IPA&quot; style=&quot;font-family: &#039;Arial Unicode MS&#039;, &#039;Lucida Sans Unicode&#039;;&quot; title=&quot;Pronunciation in IPA&quot;&gt;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=WP:IPA_for_Spanish&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none;&quot; title=&quot;WP:IPA for Spanish (trang chưa được viết)&quot;&gt;[reˈpu&amp;beta;lika arxenˈtina]&lt;/a&gt;&lt;/span&gt;,&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Ti%E1%BA%BFng_Vi%E1%BB%87t&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Tiếng Việt&quot;&gt;Tiếng Việt&lt;/a&gt;: Cộng h&amp;ograve;a &amp;Aacute;c-hen-ti-na&lt;sup class=&quot;reference&quot; id=&quot;cite_ref-6&quot; style=&quot;line-height: 1em; font-size: 10px; white-space: nowrap;&quot;&gt;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Argentina#cite_note-6&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot;&gt;[6]&lt;/a&gt;&lt;/sup&gt;,&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://vi.wikipedia.org/wiki/H%C3%A1n_-_Vi%E1%BB%87t&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Hán - Việt&quot;&gt;H&amp;aacute;n - Việt&lt;/a&gt;:&amp;nbsp;&lt;b&gt;&amp;Aacute; Căn Đ&amp;igrave;nh&lt;/b&gt;), l&amp;agrave; quốc gia lớn thứ hai ở&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Nam_M%E1%BB%B9&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Nam Mỹ&quot;&gt;Nam Mỹ&lt;/a&gt;&amp;nbsp;theo diện t&amp;iacute;ch đất, sau&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Brasil&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Brasil&quot;&gt;Brasil&lt;/a&gt;. Quốc gia n&amp;agrave;y theo thể&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Li%C3%AAn_bang&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Liên bang&quot;&gt;li&amp;ecirc;n bang&lt;/a&gt;, h&amp;igrave;nh th&amp;agrave;nh với 23&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/T%E1%BB%89nh&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Tỉnh&quot;&gt;tỉnh&lt;/a&gt;&amp;nbsp;v&amp;agrave; một&amp;nbsp;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=Th%C3%A0nh_ph%E1%BB%91_t%E1%BB%B1_tr%E1%BB%8B&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none;&quot; title=&quot;Thành phố tự trị (trang chưa được viết)&quot;&gt;th&amp;agrave;nh phố tự trị&lt;/a&gt;&amp;nbsp;l&amp;agrave;&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Th%E1%BB%A7_%C4%91%C3%B4&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Thủ đô&quot;&gt;thủ đ&amp;ocirc;&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Buenos_Aires&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Buenos Aires&quot;&gt;Buenos Aires&lt;/a&gt;. Argentina c&amp;oacute; diện t&amp;iacute;ch đứng thứ t&amp;aacute;m tr&amp;ecirc;n thế giới về diện t&amp;iacute;ch đất liền v&amp;agrave; lớn nhất trong số&amp;nbsp;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=Hispanophone&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none;&quot; title=&quot;Hispanophone (trang chưa được viết)&quot;&gt;c&amp;aacute;c nước n&amp;oacute;i tiếng T&amp;acirc;y Ban Nha&lt;/a&gt;, mặc d&amp;ugrave;&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/M%C3%A9xico&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;México&quot;&gt;M&amp;eacute;xico&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Colombia&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Colombia&quot;&gt;Colombia&lt;/a&gt;&amp;nbsp;v&amp;agrave;&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/T%C3%A2y_Ban_Nha&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Tây Ban Nha&quot;&gt;T&amp;acirc;y Ban Nha&lt;/a&gt;&amp;nbsp;đ&amp;ocirc;ng d&amp;acirc;n hơn.&lt;/p&gt;\r\n&lt;p style=&quot;margin-top: 0.4em; margin-right: 0px; margin-left: 0px; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px;&quot;&gt;\r\n	Địa h&amp;igrave;nh Argentina bao gồm diện t&amp;iacute;ch từ&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/D%C3%A3y_n%C3%BAi&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Dãy núi&quot;&gt;d&amp;atilde;y n&amp;uacute;i&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Andes&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Andes&quot;&gt;Andes&lt;/a&gt;&amp;nbsp;ở ph&amp;iacute;a t&amp;acirc;y đến&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/%C4%90%E1%BA%A1i_T%C3%A2y_D%C6%B0%C6%A1ng&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Đại Tây Dương&quot;&gt;Đại T&amp;acirc;y Dương&lt;/a&gt;&amp;nbsp;ở ph&amp;iacute;a đ&amp;ocirc;ng. Quốc gia n&amp;agrave;y gi&amp;aacute;p&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Paraguay&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Paraguay&quot;&gt;Paraguay&lt;/a&gt;&amp;nbsp;v&amp;agrave;&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Bolivia&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Bolivia&quot;&gt;Bolivia&lt;/a&gt;&amp;nbsp;về phi&amp;aacute; bắc,&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Brasil&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Brasil&quot;&gt;Brasil&lt;/a&gt;&amp;nbsp;v&amp;agrave;&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Uruguay&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Uruguay&quot;&gt;Uruguay&lt;/a&gt;&amp;nbsp;về ph&amp;iacute;a đ&amp;ocirc;ng bắc, v&amp;agrave;&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Chile&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Chile&quot;&gt;Chile&lt;/a&gt;&amp;nbsp;về ph&amp;iacute;a t&amp;acirc;y v&amp;agrave; nam. Argentine tuy&amp;ecirc;n bố chủ quyền ở&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Ch%C3%A2u_Nam_C%E1%BB%B1c&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Châu Nam Cực&quot;&gt;Ch&amp;acirc;u Nam Cực&lt;/a&gt;&amp;nbsp;nhưng l&amp;atilde;nh phận n&amp;agrave;y lấn l&amp;ecirc;n khu vực tranh chấp với&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Chile&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Chile&quot;&gt;Chile&lt;/a&gt;&amp;nbsp;v&amp;agrave;&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://vi.wikipedia.org/wiki/V%C6%B0%C6%A1ng_qu%E1%BB%91c_Li%C3%AAn_hi%E1%BB%87p_Anh&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Vương quốc Liên hiệp Anh&quot;&gt;Vương quốc Li&amp;ecirc;n hiệp Anh&lt;/a&gt;. Về mặt ph&amp;aacute;p l&amp;yacute; quốc tế,&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/H%E1%BB%87_th%E1%BB%91ng_Hi%E1%BB%87p_%C6%B0%E1%BB%9Bc_V%C3%B9ng_Nam_C%E1%BB%B1c&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Hệ thống Hiệp ước Vùng Nam Cực&quot;&gt;Hệ thống Hiệp ước V&amp;ugrave;ng Nam Cực&lt;/a&gt;&amp;nbsp;k&amp;yacute; năm&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/1961&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;1961&quot;&gt;1961&lt;/a&gt;&amp;nbsp;đ&amp;atilde; v&amp;ocirc; hiệu h&amp;oacute;a tuy&amp;ecirc;n bố chủ quyền của mọi nước. Argentina cũng tuy&amp;ecirc;n bố chủ quyền tr&amp;ecirc;n&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Qu%E1%BA%A7n_%C4%91%E1%BA%A3o_Falkland&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Quần đảo Falkland&quot;&gt;Quần đảo Falkland&lt;/a&gt;&amp;nbsp;(&lt;a href=&quot;http://vi.wikipedia.org/wiki/Ti%E1%BA%BFng_T%C3%A2y_Ban_Nha&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Tiếng Tây Ban Nha&quot;&gt;tiếng T&amp;acirc;y Ban Nha&lt;/a&gt;:&amp;nbsp;&lt;span lang=&quot;es&quot;&gt;&lt;i&gt;Islas Malvinas&lt;/i&gt;&lt;/span&gt;),&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Nam_Georgia_v%C3%A0_Qu%E1%BA%A7n_%C4%91%E1%BA%A3o_Nam_Sandwich&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Nam Georgia và Quần đảo Nam Sandwich&quot;&gt;Nam Georgia v&amp;agrave; Quần đảo Nam Sandwich&lt;/a&gt;. Những nh&amp;oacute;m đảo n&amp;agrave;y hiện do&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://vi.wikipedia.org/wiki/V%C6%B0%C6%A1ng_qu%E1%BB%91c_Li%C3%AAn_hi%E1%BB%87p_Anh&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Vương quốc Liên hiệp Anh&quot;&gt;Anh&lt;/a&gt;&amp;nbsp;quản l&amp;yacute; theo kiểu&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/L%C3%A3nh_th%E1%BB%95_h%E1%BA%A3i_ngo%E1%BA%A1i_thu%E1%BB%99c_Anh&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Lãnh thổ hải ngoại thuộc Anh&quot;&gt;L&amp;atilde;nh thổ hải ngoại thuộc Anh&lt;/a&gt;.&lt;/p&gt;\r\n&lt;p style=&quot;margin-top: 0.4em; margin-right: 0px; margin-left: 0px; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px;&quot;&gt;\r\n	L&amp;agrave; một&amp;nbsp;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=C%C6%B0%E1%BB%9Dng_qu%E1%BB%91c_b%E1%BA%ADc_trung&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none;&quot; title=&quot;Cường quốc bậc trung (trang chưa được viết)&quot;&gt;Cường quốc bậc trung&lt;/a&gt;&amp;nbsp;(middle power) được thừa nhận,&lt;sup class=&quot;reference&quot; id=&quot;cite_ref-Wurst_7-0&quot; style=&quot;line-height: 1em; font-size: 10px; white-space: nowrap;&quot;&gt;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Argentina#cite_note-Wurst-7&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot;&gt;[7]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;Argentina l&amp;agrave; nền kinh tế lớn thứ ba&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/M%E1%BB%B9_Latinh&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Mỹ Latinh&quot;&gt;Mỹ Latinh&lt;/a&gt;,&lt;sup class=&quot;reference&quot; id=&quot;cite_ref-8&quot; style=&quot;line-height: 1em; font-size: 10px; white-space: nowrap;&quot;&gt;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Argentina#cite_note-8&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot;&gt;[8]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;với một xếp hạng&amp;nbsp;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=List_of_countries_by_Human_Development_Index&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none;&quot; title=&quot;List of countries by Human Development Index (trang chưa được viết)&quot;&gt;cao&lt;/a&gt;&amp;nbsp;về&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Ch%E1%BB%89_s%E1%BB%91_ph%C3%A1t_tri%E1%BB%83n_con_ng%C6%B0%E1%BB%9Di&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Chỉ số phát triển con người&quot;&gt;Chỉ số ph&amp;aacute;t triển con người&lt;/a&gt;.&lt;sup class=&quot;reference&quot; id=&quot;cite_ref-HDI_5-1&quot; style=&quot;line-height: 1em; font-size: 10px; white-space: nowrap;&quot;&gt;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Argentina#cite_note-HDI-5&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot;&gt;[5]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;Trong phạm vi&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://vi.wikipedia.org/wiki/M%E1%BB%B9_Latin&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Mỹ Latin&quot;&gt;Mỹ Latin&lt;/a&gt;, Argentina c&amp;oacute;&amp;nbsp;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=GDP_danh_ngh%C4%A9a&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none;&quot; title=&quot;GDP danh nghĩa (trang chưa được viết)&quot;&gt;GDP danh nghĩa&lt;/a&gt;&amp;nbsp;cao thứ năm v&amp;agrave; cao nhất về&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/S%E1%BB%A9c_mua_t%C6%B0%C6%A1ng_%C4%91%C6%B0%C6%A1ng&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Sức mua tương đương&quot;&gt;Sức mua tương đương&lt;/a&gt;.&lt;sup class=&quot;reference&quot; id=&quot;cite_ref-GDPppp_9-0&quot; style=&quot;line-height: 1em; font-size: 10px; white-space: nowrap;&quot;&gt;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Argentina#cite_note-GDPppp-9&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot;&gt;[9]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;C&amp;aacute;c nh&amp;agrave; ph&amp;acirc;n t&amp;iacute;ch&lt;sup class=&quot;reference&quot; id=&quot;cite_ref-10&quot; style=&quot;line-height: 1em; font-size: 10px; white-space: nowrap;&quot;&gt;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Argentina#cite_note-10&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot;&gt;[10]&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;cho rằng nước n&amp;agrave;y c&amp;oacute; &amp;quot;nền tảng cho sự ph&amp;aacute;t triển trong tương lai do k&amp;iacute;ch cỡ thị trường của n&amp;oacute;, mức độ đầu tư trực tiếp nước ngo&amp;agrave;i, v&amp;agrave; tỷ lệ khối lượng h&amp;agrave;ng h&amp;oacute;a xuất khẩu c&amp;ocirc;ng nghệ cao l&amp;agrave; phần đ&amp;oacute;ng g&amp;oacute;p quan trọng v&amp;agrave;o tổng mức sản xuất h&amp;agrave;ng h&amp;oacute;a&amp;quot;, v&amp;agrave; n&amp;oacute; được c&amp;aacute;c nh&amp;agrave; đầu tư ph&amp;acirc;n loại l&amp;agrave; một nền kinh tế mới nổi. Argentina l&amp;agrave; một th&amp;agrave;nh vi&amp;ecirc;n s&amp;aacute;ng lập của&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Li%C3%AAn_Hi%E1%BB%87p_Qu%E1%BB%91c&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Liên Hiệp Quốc&quot;&gt;Li&amp;ecirc;n Hiệp Quốc&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Mercosur&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Mercosur&quot;&gt;Mercosur&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Li%C3%AAn_minh_c%C3%A1c_Qu%E1%BB%91c_gia_Nam_M%E1%BB%B9&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Liên minh các Quốc gia Nam Mỹ&quot;&gt;Li&amp;ecirc;n minh c&amp;aacute;c Quốc gia Nam Mỹ&lt;/a&gt;,&amp;nbsp;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=T%E1%BB%95_ch%E1%BB%A9c_c%C3%A1c_qu%E1%BB%91c_gia_Iberich-M%E1%BB%B9_Latin&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none;&quot; title=&quot;Tổ chức các quốc gia Iberich-Mỹ Latin (trang chưa được viết)&quot;&gt;OEI&lt;/a&gt;,&lt;a href=&quot;http://vi.wikipedia.org/wiki/Nh%C3%B3m_Ng%C3%A2n_h%C3%A0ng_Th%E1%BA%BF_gi%E1%BB%9Bi&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Nhóm Ngân hàng Thế giới&quot;&gt;Nh&amp;oacute;m Ng&amp;acirc;n h&amp;agrave;ng Thế giới&lt;/a&gt;&amp;nbsp;v&amp;agrave;&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://vi.wikipedia.org/wiki/T%E1%BB%95_ch%E1%BB%A9c_th%C6%B0%C6%A1ng_m%E1%BA%A1i_th%E1%BA%BF_gi%E1%BB%9Bi&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;Tổ chức thương mại thế giới&quot;&gt;Tổ chức thương mại thế giới&lt;/a&gt;, v&amp;agrave; l&amp;agrave; một trong nh&amp;oacute;m c&amp;aacute;c nền kinh tế lớn&amp;nbsp;&lt;a href=&quot;http://vi.wikipedia.org/wiki/G20&quot; style=&quot;color: rgb(11, 0, 128); background-image: none;&quot; title=&quot;G20&quot;&gt;G20&lt;/a&gt;.&lt;/p&gt;', '&lt;p&gt;\r\n	&lt;a href=&quot;#sublink53&quot;&gt;test 1&lt;/a&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;a href=&quot;#sublink53&quot;&gt;test 2&lt;/a&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;a href=&quot;#sublink54&quot;&gt;test 3&lt;/a&gt;&lt;/p&gt;', '', '', '', '', '', 'abc', 'dè', 0, 0, 'upload/logo.png', 0, '', '', '', 0, 0, 'active', '', '2013-02-26 15:30:58', 'admin', '2013-02-26 15:30:58'),
(53, 'default13618673431', '', 'subinfor', '', 'admin', 'thử 1', '', '', 'vn', '', '&lt;p&gt;\r\n	&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;T&amp;ecirc;n gọi Argentina được bắt nguồn từ tiếng&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Latinh&quot; style=&quot;color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot; title=&quot;Latinh&quot;&gt;Latinh&lt;/a&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;i style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;argentum&lt;/i&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;&amp;nbsp;(&amp;quot; nghĩa l&amp;agrave;&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;http://vi.wikipedia.org/wiki/B%E1%BA%A1c&quot; style=&quot;color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot; title=&quot;Bạc&quot;&gt;Bạc&lt;/a&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;&amp;quot;). Việc sử dụng lần đầu ti&amp;ecirc;n từ nguy&amp;ecirc;n &amp;quot;Argentina&amp;quot; c&amp;oacute; thể được t&amp;igrave;m thấy v&amp;agrave;o năm 1602 trong b&amp;agrave;i thơ&amp;nbsp;&lt;/span&gt;&lt;i style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;La Argentina y conquista del R&amp;iacute;o de la Plata&lt;/i&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;&amp;nbsp;(&lt;/span&gt;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Ti%E1%BA%BFng_Vi%E1%BB%87t&quot; style=&quot;color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot; title=&quot;Tiếng Việt&quot;&gt;tiếng Việt&lt;/a&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;:&amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;vi&quot; style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;&lt;i&gt;Argentina v&amp;agrave; cuộc chinh phục d&amp;ograve;ng s&amp;ocirc;ng bạc&lt;/i&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;) của&amp;nbsp;&lt;/span&gt;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=Mart%C3%ADn_del_Barco_Centenera&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot; title=&quot;Martín del Barco Centenera (trang chưa được viết)&quot;&gt;Mart&amp;iacute;n del Barco Centenera&lt;/a&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;. Mặc d&amp;ugrave; t&amp;ecirc;n n&amp;agrave;y đ&amp;atilde; được d&amp;ugrave;ng phổ biến để gọi&amp;nbsp;&lt;/span&gt;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=L%C6%B0u_v%E1%BB%B1c_s%C3%B4ng_La_Plata&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot; title=&quot;Lưu vực sông La Plata (trang chưa được viết)&quot;&gt;Lưu vực s&amp;ocirc;ng La Plata&lt;/a&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;&amp;nbsp;v&amp;agrave;o thế kỷ thứ 18, nhưng t&amp;ecirc;n ch&amp;iacute;nh thức của v&amp;ugrave;ng đất n&amp;agrave;y vốn được gọi l&amp;agrave;&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;http://vi.wikipedia.org/wiki/Ph%C3%B3_v%C6%B0%C6%A1ng_qu%E1%BB%91c_R%C3%ADo_de_la_Plata&quot; style=&quot;text-decoration: underline; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot; title=&quot;Phó vương quốc Río de la Plata&quot;&gt;Ph&amp;oacute; vương quốc R&amp;iacute;o de la Plata&lt;/a&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;&amp;nbsp;từ năm 1776. Những ch&amp;iacute;nh phủ tự trị nổi l&amp;ecirc;n từ&amp;nbsp;&lt;/span&gt;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=Cu%E1%BB%99c_c%C3%A1ch_m%E1%BA%A1ng_th%C3%A1ng_5&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot; title=&quot;Cuộc cách mạng tháng 5 (trang chưa được viết)&quot;&gt;cuộc c&amp;aacute;ch mạng th&amp;aacute;ng 5&lt;/a&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;&amp;nbsp;năm 1810 đ&amp;atilde; thay thế từ &amp;quot;Ph&amp;oacute; vương&amp;quot; bằng &amp;quot;&lt;/span&gt;&lt;a class=&quot;new&quot; href=&quot;http://vi.wikipedia.org/w/index.php?title=C%C3%A1c_t%E1%BB%89nh_th%E1%BB%91ng_nh%E1%BA%A5t_R%C3%ADo_de_la_Plata&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;color: rgb(165, 88, 88); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot; title=&quot;Các tỉnh thống nhất Río de la Plata (trang chưa được viết)&quot;&gt;C&amp;aacute;c tỉnh thống nhất&lt;/a&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: sans-serif; font-size: 13px; line-height: 19.1875px;&quot;&gt;&amp;quot;.&lt;/span&gt;&lt;/p&gt;', '', '[51]', '', '', '', '', '', 0, 0, '', 0, '', '', '', 0, 0, 'active', '', '2013-02-26 15:29:03', 'admin', '2013-02-26 15:29:03');
